import React, { useEffect, useState } from "react";
import PanelTemplate from "./PanelTemplate";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";// Tabloyu PDF'e düzgün yerleştirmek için gerekli

function Reports() {
    const [persons, setPersons] = useState([]);
    const [selectedPerson, setSelectedPerson] = useState(null);
    const [personDetails, setPersonDetails] = useState([]);

    useEffect(() => {
        fetch("http://localhost:5003/manager/generalReport")
            .then(res => res.json())
            .then(data => {
                if (data.success) {
                    setPersons(data.report);
                }
            })
            .catch(err => console.error("Fetch error:", err));
    }, []);

    // ==========================================
    //   PDF OLUŞTURMA VE İNDİRME FONKSİYONU
    // ==========================================
    const downloadPDF = () => {
        try {
            // 1. jspdf objesini oluştur
            const doc = new jsPDF({
                orientation: "landscape", // Yatay mod
                unit: "mm",
                format: "a4"
            });

            // 2. Başlık ve Tasarım
            doc.setFontSize(18);
            doc.text("Genel Personel ve Musteri Raporu", 14, 15);
            doc.setFontSize(10);
            doc.text(`Olusturulma Tarihi: ${new Date().toLocaleString()}`, 14, 22);

            // 3. Tablo Sütun Başlıkları
            const columns = [
                { header: 'ID', dataKey: 'person_id' },
                { header: 'Ad', dataKey: 'first_name' },
                { header: 'Soyad', dataKey: 'last_name' },
                { header: 'Cinsiyet', dataKey: 'gender' },
                { header: 'Email', dataKey: 'email' },
                { header: 'Sehir', dataKey: 'city' },
                { header: 'Rol', dataKey: 'role' }
            ];

            // 4. autoTable fonksiyonunu çağır
            // ÖNEMLİ: doc.autoTable şeklinde kullanmalısın
            doc.autoTable({
                columns: columns,
                body: persons, // persons state'indeki verileri doğrudan basar
                startY: 30,
                theme: 'grid',
                headStyles: { fillColor: [83, 132, 86] }, // Senin buton rengin (#538456ff)
                margin: { top: 30 }
            });

            // 5. Kaydet
            doc.save("Person_Report.pdf");
            console.log("PDF başarıyla oluşturuldu.");

        } catch (error) {
            console.error("PDF Hatası:", error);
            alert("PDF oluşturulurken bir hata oluştu. Konsol (F12) kayıtlarına bakın.");
        }
    };

    return (
        <PanelTemplate
            title="Reports"
            rightContent={
                <div style={{ width: "100%" }}>
                    <div style={{ marginBottom: "20px", display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                        <h2 style={{ color: "#2f4036" }}>General Person List</h2>

                        {/* PDF BUTONU AKTİFLEŞTİRİLDİ */}
                        <button
                            type="button"
                            onClick={downloadPDF}
                            style={{
                                backgroundColor: "#538456ff",
                                color: "white",
                                padding: "10px 25px",
                                borderRadius: "8px",
                                border: "none",
                                cursor: "pointer",
                                fontWeight: "bold",
                                boxShadow: "0 2px 4px rgba(0,0,0,0.2)"
                            }}
                        >
                            Download PDF Report
                        </button>
                    </div>

                    <table className="orders-table" border="1">
                        <thead>
                            <tr>
                                <th>ID</th>
                                <th>First Name</th>
                                <th>Last Name</th>
                                <th>Gender</th>
                                <th>Email</th>
                                <th>City</th>
                                <th>Phone</th>
                                <th>Age</th>
                                <th>Role</th>
                            </tr>
                        </thead>
                        <tbody>
                            {persons.map(p => (
                                <tr key={p.person_id} style={{ cursor: "pointer" }}>
                                    <td>{p.person_id}</td>
                                    <td>{p.first_name}</td>
                                    <td>{p.last_name}</td>
                                    <td>{p.gender}</td>
                                    <td>{p.email}</td>
                                    <td>{p.city}</td>
                                    <td>{p.phone_number}</td>
                                    <td>{p.age}</td>
                                    <td style={{ fontWeight: "bold" }}>{p.role}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            }
        />
    );
}

export default Reports;
